    /// <summary>
    /// This is a test class for InterProcessLauncherTest and is intended
    /// to contain all InterProcessLauncherTest Unit Tests
    /// </summary>
    [Trait("Category", "CI")]
    public class InterProcessLauncherTest
    {
        /// <summary>
        /// Verifies the default values of the Data object when a new instance
        /// is created.
        /// </summary>
        [Fact]
        public void cTorTest_DefaultValues()
        {
            var launcher = new InterProcessLauncher();
            InterProcessData resultData = launcher.Data;

            Assert.NotNull(resultData);

            Assert.Null(launcher.Command);
            Assert.Null(resultData.Data1);
            Assert.Null(resultData.Data2);
        }

        /// <summary>
        /// Verifies that setting that the class doesn't change the input data
        /// any as it's set.
        /// </summary>
        [Fact]
        public void cTorTest_SetData()
        {
            const string TestData1 = "http://item-fwb-bl3.se.nos.boeing.com/dcloc";
            var launcher = new InterProcessLauncher
            {
                Command = "LaunchIE",
                Data = { Data1 = TestData1, Data2 = TestData2 }
            };

            Assert.Equal("LaunchIE", launcher.Command);
            Assert.Equal(TestData1, launcher.Data.Data1);
            Assert.Equal(TestData2, launcher.Data.Data2);
        }

        /// <summary>
        /// Verifies launching launcher with a null command throws and
        /// exception.
        /// </summary>
        [Fact]
        public void LaunchTest_NullCommand()
        {
            var launcher = new InterProcessLauncher { Command = null };
            Assert.Throws<ArgumentNullException>(() => launcher.Launch());
        }

        /// <summary>
        /// Verifies launching launcher with a empty string command throws and
        /// exception.
        /// </summary>
        [Fact]
        public void LaunchTest_EmptyCommand()
        {
            var launcher = new InterProcessLauncher { Command = string.Empty };
            Assert.Throws<ArgumentNullException>(() => launcher.Launch());
        }

        /// <summary>
        /// Verifies launching the launcher with valid data and command that the
        /// process is started.
        /// </summary>
        [Fact]
        public void LaunchTest_ValidCommandFakedProcessLauncher()
        {
            var proxy = new Mock<IProcessProxy>();
            proxy.Setup(p => p.Start()).Returns(true);
            proxy.Setup(p => p.WaitForExit());

            var startInfo = new ProcessStartInfo();
            proxy.SetupGet(p => p.StartInfo).Returns(startInfo);

            const string TestData1 = "http://item-fwb-bl3.se.nos.boeing.com/dcloc";
            var launcher = new InterProcessLauncher(proxy.Object)
                {
                    Command = "LaunchIE",
                    Data = { Data1 = TestData1, Data2 = TestData2 }
                };

            launcher.Launch();

            proxy.Verify(p => p.Start(), Times.Once);
            proxy.Verify(p => p.WaitForExit(), Times.Once);

            Assert.NotNull(startInfo);
            Assert.StartsWith(" " + launcher.Command, startInfo.Arguments);
            Assert.True(startInfo.UseShellExecute, "Value to use shell was not set.");
            Assert.True(startInfo.CreateNoWindow, "Value to create no command window was not set.");
            Assert.Equal("Oliviann.Reuse.InterProcessHelper.exe", startInfo.FileName);
        }

        /// <summary>
        /// Verifies a not implemented exception is thrown.
        /// </summary>
        [Fact]
        public void LaunchAsync_NoErrors()
        {
            var launcher = new InterProcessLauncher();
            Assert.Throws<NotImplementedException>(() => launcher.LaunchAsync());
        }

